/*
MERINVTEST is a table composed of all the 'matchable' lines from MERINV.csv. 

Here I am selecting everything from MERINVTEST which is in a list generated from 
phpMyAdmin that contains records from all SS13A MER simple products with a 'backorders' value of 0. 

In order to compare with MERINVTEST, the list is formatted as follows:
	- Apparel Simple Products: material code + color code + size code 
	- Footwear Simple Products: material code + size code
	
The resulting records are all line items originally from MERINV.csv which SHOULD be matching up with simple products in Magento, but aren't.
 */

SELECT a.sku, a.image, x.*
FROM LOT_Inventory.dbo.tbl_LoadFile_SS13_MER AS a
INNER JOIN
(SELECT Material, Size
FROM MERINVTEST
WHERE Material + '-' + CASE WHEN LEN(Size) <> 4 AND Size LIKE '%.%' THEN '0' + Size WHEN LEN(Size) <> 4 AND Size NOT LIKE '%.%' THEN Size + '0' END 
